function menuSearch(e){var $input=$(e),list=$("a:not(.exculude-search)"),uniqueList=[];list.each((function(index,item){if($(item).text().trim().match(new RegExp($input.val(),"gi"))){var hrf=$(item).attr("href"),link_txt=$(item).text().trim();if(void 0===hrf||""===hrf||hrf.startsWith("#"))return;var newItem={label:link_txt,hrf:hrf};uniqueList.some((function(uniqueItem){return uniqueItem.hrf===newItem.hrf}))||uniqueList.push(newItem)}}));var options={source:uniqueList,select:function(event,ui){return event.preventDefault(),$input.val(ui.item.label),window.location.href=ui.item.hrf,!1},appendTo:"body",open:function(event,ui){$(this).autocomplete("widget").css("z-index",9999)}};$input.autocomplete(options)}